import "../styles/navbar.css"
const Navbar = () => {
    return (
        <nav className = "navbar">
            <h1>Analyse Codehub</h1>
                <div className="links">
                    <ul>
                        <li><a href="/">Home</a></li>
                        <li><a href="/Profile">jv</a></li>
                    </ul>
            </div>
        </nav>
    );
}

export default Navbar;
